create table energieverbrauch
(
    Kennummer     int         not null
        primary key,
    GruppenNr     int         not null,
    Nahrungsarten varchar(60) not null,
    Verbrauch     float       not null
)
    collate = latin1_general_ci;

create index gruppe
    on energieverbrauch (GruppenNr);

create index nahrungsarten
    on energieverbrauch (Nahrungsarten);

